import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (props) => {
  return (
    <div className="tile-list">
      <table>
        <thead>
          <tr>
            <th scope="col">{props.firstCol}</th>
            <th scope="col">{props.secondCol}</th>
            <th scope="col">{props.thirdCol}</th>
          </tr>
        </thead>
        <tbody>
          {props.data.map((item, index) => (
            <tr key={index} className="tile">
              <Tile name={item.name} phone={item.phone} email={item.email} />
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
